import React from 'react';
import Overview from './Overview';
import ActivityList from './ActivityList';

const Dashboard = () => {
  return (
    <div>
      <h1>Dashboard</h1>
      <Overview />
      <ActivityList />
    </div>
  );
};

export default Dashboard;
